import UserComponent from "./UserComponent";
import "./App.css";

function App() {

  return (
    <div className="App">
      {users.map((user, index) => {
        return (
          <UserComponent
            key={index}
            name={user.name}
            age={user.age}
            email={user.email}
          />
        );
      })}
    </div>
  );
}

export default App;
